import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Home from "./Home";
import Header from "./Layout/Header.js"
import "./App.css";

function App() {
  return (
    <Router>
      <Header />
      <div>
        <Route exact path={"/"} component={Home} />
      </div>
    </Router>
  );
}

export default App;
